export const Our_Journey = (props) => {
    return (
      <div id='our_journey' className='text-center'>
        <div className='container'>
            <div className='journey-title'>
        <h2>Our Journey</h2> 
        </div>
        <div className='journey-image'>
        <div className= 'front-journey '> 
            <img src="./img/frontjourney.png" className="img-responsive" alt="" />{" "}
              <div className = 'background-journey'>
              <img src="./img/journey.png" className="img-responsive" alt="" />{" "} 
              
          </div>
          </div>
        </div>
        </div>
    </div>
     )
    }
